import React from 'react';
import './Navigation.css'
import logo from '../static/logo.png'
import { Link } from ""

function Navigation() {



  return (
<div className="navigation__wrapper">
<a href="/" className="navigation__logo">
<img src={logo}/>
  <h2>YOURNAME</h2></a>

<ul className="navigation__list">
<Link
    activeClass="active"
    to="about"
    spy={true}
    smooth={true}
    offset={-70}
    duration={500}
>
<li>O Nas</li></Link>

<Link
    activeClass="active"
    to="section1"
    spy={true}
    smooth={true}
    offset={-70}
    duration={500}
><li>Us≈Çugi</li>
<li>Realizacje</li>
</Link>

<Link
    activeClass="active"
    to="section1"
    spy={true}
    smooth={true}
    offset={-70}
    duration={500}
><li>Kontakt</li></Link>
</ul>
</div> 

  );
}

export default Navigation;
